import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to load (ensure at least one product card is present)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click the first product card to open its detail modal
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for the product modal to appear
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    await page.waitForSelector('.add-to-wishlist', { timeout: 5000 });

    // Take screenshot of product detail modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Click the "Add to Wish List" button
    const wishlistBtn = await page.$('.add-to-wishlist');
    if (!wishlistBtn) throw new Error('Add to Wish List button not found');
    await wishlistBtn.click();

    // Wait for notification to appear ("Added to wishlist!")
    await page.waitForSelector('.notification.success', { timeout: 3000 });

    // Take screenshot after adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_wishlist.png'));

    // Close the product modal (by clicking the close button)
    const closeBtn = await page.$('#productModal .close');
    if (closeBtn) {
      await closeBtn.click();
      await page.waitForSelector('#productModal', { state: 'hidden', timeout: 3000 });
    }

    // Navigate to the Wish List page
    // Try to find a visible "Your Wish List" link (multiple exist; pick the first visible one)
    const wishlistLinks = await page.$$('a');
    let wishlistLinkFound = false;
    for (const link of wishlistLinks) {
      const text = await link.textContent();
      if (text && text.trim().toLowerCase() === 'your wish list') {
        // Scroll into view and click
        await link.scrollIntoViewIfNeeded();
        await link.click();
        wishlistLinkFound = true;
        break;
      }
    }
    if (!wishlistLinkFound) throw new Error('Your Wish List link not found');

    // Wait for the wishlist page to load (wait for .wishlist-page or .wishlist-items)
    await page.waitForSelector('.wishlist-page, .wishlist-items', { timeout: 5000 });

    // Take screenshot of the wishlist page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    // Extract the title of the first wishlist item to verify
    const wishlistItemTitle = await page.$eval('.wishlist-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Added a product to the wishlist and verified it appears in the wishlist page.",
      extractedData: {
        wishlistFirstItemTitle: wishlistItemTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
